// Entrada: o usuário pode enviar o ID ou o link completo
const input = $('Webhook').first().json.body['card-clickup'] || ''; // exemplo: "https://app.clickup.com/t/86acb1phd" ou "86acb1phd"

// Expressão regular pra capturar o ID
const match = input.match(/([a-z0-9]{9,})$/i);

return {
  id: match ? match[1] : null
};

